function FocusTimer(props) {
    const focusTimer = props.focusTimer;
    const setFocusTimer = props.setFocusTimer;
    return (
        <button
        type="button"
        className="btn btn-secondary"
        data-testid="increase-focus"
        onClick={() => setFocusTimer((currentTime) => currentTime +1)}
      >
        <span className="oi oi-plus" />
      </button>
    )
}

export default FocusTimer
